import React from 'react'
import Cat from '../assets/Cat.jpg'

class ShowPatron extends React.Component {
  constructor(props) {
    super(props)

    this.state = {
      cat: Cat,

    }
  }

  render() {
    return(
      <div>
        <img src={this.state.cat} alt="cat" />
      </div>
    )
  }
}

export default ShowPatron
